  meteorological, and other data from surface sensors and CTD casts from NOAA Ship
  DISCOVERER as part of the Outer Continental Shelf Environmental Assessment Program
  (OCSEAP) from 1975-09-04 to 1975-09-30 (NODC Accession 7601585)\",\n\t\"tracking_summary\":
